import Navbar from './components/Navbar';
import './App.css';
import One from './pages/One';
import Two from './pages/Two';
import Three from './pages/Three';


function App() {
  let Component 
  switch (window.location.pathname){
    case "/" :
      Component = App
      break
      case "/one":
        Component = One
        break
        case "/two":
          Component = Two
          break
          case "/three":
            Component = Three
            break
  }
  return <Navbar></Navbar>
}

export default App;
